import React, {useState} from 'react';
import './App.css';

function buttonContainer(props){

    return(
        <div className="button-container">
                <button className="button" onClick={props.functions[0]}>Shuffle Array</button>
                <button className="button" onClick={props.functions[1]}>Merge Sort</button>
        </div>
    );
}

export default buttonContainer;
